class Solution {

const unordered_map<string, function<void(int&, int)>> OperatorToFuctor{
    {"+", plus<int>()},
    {"-", minus<int>()},
    {"*", multiplies<int>()},
    {"/", divides<int>()}
};

public:
    int evalRPN(vector<string>& tokens) {
        
        stack<int, vector<int>> Numbs;
        for(const string& token : tokens){
            if(OperatorToFuctor.count(token)){
                const int  RightOperand = Numbs.top();  Numbs.pop();
                OperatorToFuctor.at(token)(Numbs.top(), RightOperand);
            }
        }

        return Numbs.top();
    }
};

using System;
using System.IO;

public class Point () 
    {
        public double x;
        public double y;
        
        public Point input (string sr){
            Point point = new Point();
            StreamReader streamReader = new StreamReader(sr);
            point.x = Convert.ToDouble(streamReader.ReadLine());
            point.y = Convert.ToDouble(streamReader.ReadLine());

            return point;
        }
    }

public class Program
{ 
    
    public void matching (Point point, Point middle)
    {
        if (point.x == middle.x && point.y == middle.y)
        {
            Console.WriteLine("Good");
            Environment.Exit(0);
        }
        else
        {
            Console.WriteLine("Bad");
            Environment.Exit(0);
        }
    }
    
    public Point midPoint (Point point1, Point point2, Point point3, Point point4) {
        Point middle = new Point();
        if (point1.x != point2.x)
        {
            middle.x = (point1.x + point2.x) / 2;
            middle.y = (point1.y + point2.y) / 2;
        }
        else if (point1.x != point3.x)
        {
            middle.x = (point1.x + point3.x) / 2;
            middle.y = (point1.y + point3.y) / 2;
        }
        else
        {
            middle.x = (point1.x + point4.x) / 2;
            middle.y = (point1.y + point4.y) / 2;
        }
    
        return middle;
    }

    static void Main(string[] args)
    {   
        Point point1 = new Point();
        Point point2 = new Point();
        Point point3 = new Point();
        Point point4 = new Point();
        Point point = new Point();
        
        point1 = point1.input("in_1.txt");
        point2 = point2.input("in_1.txt");
        point3 = point3.input("in_1.txt");
        point4 = point4.input("in_1.txt");
    
        point = point.input("in_2.txt");
    
        middle = midPoint (point1, point2, point3, point4);
        
        matching(point, middle);
    }
}

#include <iostream>

using namespace std;

int main() {
    int num;
    cin >> num;

    double result = 0, num0To10 = 0, num10To20 = 0, num20To30 = 0, num30To40 = 0, num40To50 = 0, InvalidNum = 0, current;

    for (int i = 1; i <= num; i++) {
        cin >> current;

        if (current >= 0 && current < 10) {
            result += current * 0.2;
            num0To10++;
        }
        else if (current >= 10 && current < 20) {
            result += current * 0.3;
            num10To20++;
        }
        else if (current >= 20 && current < 30) {
            result += current * 0.4;
            num20To30++;
        }
        else if (current >= 30 && current < 40) {
            result += 50;
            num30To40++;
        }
        else if (current >= 40 && current <= 50) {
            result += 100;
            num40To50++;
        }
        else {
            result /= 2;
            InvalidNum++;
        }
    }

    cout.setf(ios::fixed);
    cout.precision(2);

    cout << result << "\n";
    cout << "From 0 to 9: " << 100.0 * num0To10 / num << "%\n";
    cout << "From 10 to 19: " << 100.0 * num10To20 / num << "%\n";
    cout << "From 20 to 29: " << 100 * num20To30 / num << "%\n";
    cout << "From 30 to 39: " << 100 * num30To40 / num << "%\n";
    cout << "From 40 to 50: " << 100 * num40To50 / num << "%\n";
    cout << "Invalid numbers: " << 100 * InvalidNum / num << "%\n";

    return 0;
}

#include <iostream>

using namespace std;

int main() {
    int studentCount;
    cin >> studentCount;

    double grade3 = 0, grade4 = 0, grade5 = 0, grade6 = 0, totalGradeSum = 0, currentGrade;

    for (int i = 0; i < studentCount; i++) {
        cin >> currentGrade;

        if (currentGrade >= 5) {
            grade6++;
        }
        else if (currentGrade >= 4) {
            grade5++;
        }
        else if (currentGrade >= 3) {
            grade4++;
        }
        else if (currentGrade >= 2) {
            grade3++;
        }

        totalGradeSum += currentGrade;
    }
    cout.setf(ios::fixed);
    cout.precision(2);

    cout << "Top students: " << 100.0 * grade6 / studentCount << "%\n";
    cout << "Between 4.00 and 4.99: " << 100.0 * grade5 / studentCount << "%\n";
    cout << "Between 3.00 and 3.99: " << 100.0 * grade4 / studentCount << "%\n";
    cout << "Fail: " << 100.0 * grade3 / studentCount << "%\n";
    cout << "Average: " << 1.0 * totalGradeSum / studentCount << endl;

    return 0;
}

