#include<stdio.h>
#include<stdlib.h>
#include<strings.h>
#include<ctype.h>

int main(){

    char command = '0';

    printf("Enter 10 numbers (seperated by spaces): \n");

    int numbers[10];

    for(int i = 0; i < 10; i++){
        scanf("%d", &numbers[i]);
    }


    while (1){
        printf("Divisibility\n");
        printf("1. Display original numbers\n");
        printf("2. Find odd numbers\n");
        printf("3. Find numbers divisible by ?\n");
        printf("0. EXIT\n");


        scanf(" %c", &command);
        command = tolower(command);

        if(command == '1'){
            for (int i = 0; i <10; ++i) {
                printf("%d ", numbers[i]);
            }
            printf("\n\n");
        }else if(command == '2'){
            // 5 odd values found: 1,2,3,4,5

            int oddCount = 0;
            for (int i = 0; i < 10; ++i) {
                if(numbers[i] % 2 != 0){
                    oddCount++;
                }
            }

            printf("%d odd values found: ", oddCount);
            for (int i = 0; i < 10; ++i) {
                if(numbers[i] % 2 != 0){
                    printf("%d ", numbers[i]);
                }
            }
            printf("\n\n");
        }else if(command == '3'){
            int divisor = 0;
            printf("Which number should these be divisible by? ");
            scanf("%d", &divisor);

            int divisibleCount = 0;
            for (int i = 0; i < 10; ++i) {
                if(numbers[i] % divisor == 0){
                    divisibleCount++;
                }
            }

            printf("%d values found which are divisible by %d: ", divisibleCount, divisor);
            for (int i = 0; i < 10; ++i) {
                if(numbers[i] % divisor == 0){
                    printf("%d ", numbers[i]);
                }
            }
            printf("\n\n");
        } else {
            printf("Invalid option. Please choose again.\n");
        }
    }





	return 0;
}

