int main(){

    char command = '0';


    while (1){
        printf("(N)umbers\n");
        printf("(D)raw\n");
        printf("e(X)it\n");

        printf("Enter a character of your selection: ");

        scanf(" %c", &command);
        command = tolower(command);

        if(command == 'n'){
            int num = 10;
            do {
                printf("Please enter a number (0 to exit): ");

                scanf("%d", &num);

                if (num == 0){
                    break;
                }

                if(num%2 == 0){
                    printf("%d is even.\n", num);
                } else {
                    printf("%d is odd.\n", num);
                }
                } while (1);

        }else if(command == 'd'){
            int num = 0;
            printf("Please enter a size larger then 2: ");
            scanf("%d", &num);

            for(int i = 0; i < num; i++){
            	for (int m =i; m<num; m++){
            		printf(" ");
            	}
                for(int j =0; j<=i*2; j++){
                	printf("*");
                }
                printf("\n");
            }

        }
        else if(command == 'x'){
            break;
        } else {
            printf("Please enter a valid option.\n");
        }
    }





	return 0;
}

#include <ESP8266WiFi.h>
#include <ESP8266WebServer.h>
#include <OneWire.h>
#include <DallasTemperature.h>

/* Put your SSID & Password */
const char* ssid = "Temp";  // Enter SSID here
const char* password = "12345678";  //Enter Password here

/* Put IP Address details */
IPAddress local_ip(192,168,1,1);
IPAddress gateway(192,168,1,1);
IPAddress subnet(255,255,255,0);

ESP8266WebServer server(80);

uint8_t temppin = D2;
bool tempstatus = LOW;

OneWire oneWire(temppin);

// Pass our oneWire reference to Dallas Temperature.
DallasTemperature sensors(&oneWire);

float tempSensor1;

void setup() {
  Serial.begin(115200);
  pinMode(temppin, OUTPUT);

  WiFi.softAP(ssid, password);
  WiFi.softAPConfig(local_ip, gateway, subnet);
  delay(100);
  
  server.on("/", handle_OnConnect);
  server.on("/tempon", handle_tempon);
  server.on("/tempoff", handle_tempoff);
  server.onNotFound(handle_NotFound);
  
  server.begin();
  Serial.println("HTTP server started");
}
void loop() {
  server.handleClient();
  if(tempstatus){
    digitalWrite(temppin, HIGH);
  }else{
    digitalWrite(temppin, LOW);
  }
}

void handle_OnConnect() {
  tempSensor1 = 0;
  tempstatus = LOW;
  Serial.println("GPIO2 Status: OFF");
  server.send(200, "text/html", SendHTML(tempstatus,tempSensor1)); 
}

void handle_tempon() {
  sensors.requestTemperatures();
  tempSensor1 = sensors.getTempCByIndex(0);
  tempstatus = HIGH;
  Serial.println("GPIO2 Status: ON");
  server.send(200, "text/html", SendHTML(true,tempSensor1)); 
}

void handle_tempoff() {
  tempSensor1 = 0;
  tempstatus = LOW;
  Serial.println("GPIO2 Status: OFF");
  server.send(200, "text/html", SendHTML(false,tempSensor1)); 
}

void handle_NotFound(){
  server.send(404, "text/plain", "Not found");
}

String SendHTML(uint8_t tempstat, float tempSensor1){
  String ptr = "<!DOCTYPE html> <html>\n";
  ptr +="<head><meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, user-scalable=no\">\n";
  ptr +="<title>Temp Control</title>\n";
  ptr +="<style>html { font-family: Helvetica; display: inline-block; margin: 0px auto; text-align: center;}\n";
  ptr +="body{margin-top: 50px;} h1 {color: #444444;margin: 50px auto 30px;} h3 {color: #444444;margin-bottom: 50px;}\n";
  ptr +=".button {display: block;width: 80px;background-color: #1abc9c;border: none;color: white;padding: 13px 30px;text-decoration: none;font-size: 25px;margin: 0px auto 35px;cursor: pointer;border-radius: 4px; margin-top: 10px;}\n";
  ptr +=".button-on {background-color: #1abc9c;}\n";
  ptr +=".button-on:active {background-color: #16a085;}\n";
  ptr +=".button-off {background-color: #34495e;}\n";
  ptr +=".button-off:active {background-color: #2c3e50;}\n";
  ptr +="p {font-size: 14px;color: #888;margin-bottom: 10px;}\n";
  ptr +="</style>\n";
  ptr +="<script>\n";
  ptr +="setInterval(loadDoc,200);\n";
  ptr +="function loadDoc() {\n";
  ptr +="var xhttp = new XMLHttpRequest();\n";
  ptr +="xhttp.onreadystatechange = function() {\n";
  ptr +="if (this.readyState == 4 && this.status == 200) {\n";
  ptr +="document.getElementById(\"webpage\").innerHTML =this.responseText}\n";
  ptr +="};\n";
  ptr +="xhttp.open(\"GET\", \"/\", true);\n";
  ptr +="xhttp.send();\n";
  ptr +="}\n";
  ptr +="</script>\n";
  ptr +="</head>\n";
  ptr +="<body>\n";
  ptr +="<h1>ESP8266 Web Server Temperature</h1>\n";
  ptr +="<h3>Using Access Point(AP) Mode</h3>\n";
  
  if(tempstat){
    ptr +="<p>Temp Status: ON</p>\n";
    ptr +=tempSensor1;
    ptr +="\n";
    ptr +="<a class=\"button button-off\" href=\"/tempoff\">OFF</a>\n";
    ptr +="</div>";
  } else {
    ptr +="<p>Temp Status: OFF</p>\n";
    ptr +="<div id=\"webpage\">\n";
    ptr +=tempSensor1;
    ptr +="\n";
    ptr +="<a class=\"button button-on\" href=\"/tempon\">ON</a>\n";
  }


  ptr +="</body>\n";
  ptr +="</html>\n";
  return ptr;
}

