import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

class User {
    private String email;
    private String password;
    private String username;

    public User(String email, String password, String username) {
        this.email = email;
        this.password = password;
        this.username = username;
    }

    public String getEmail() {
        return email;
    }

    public String getPassword() {
        return password;
    }

    public String getUsername() {
        return username;
    }
}

class UserManager {
    private List<User> users = new ArrayList<>();

    public void registerUser(String email, String password, String username) {
        users.add(new User(email, password, username));
        System.out.println("Registration successful!");
    }

    public User loginUser(String email, String password) {
        for (User user : users) {
            if (user.getEmail().equals(email) && user.getPassword().equals(password)) {
                return user;
            }
        }
        return null; // User not found
    }
}

public class UserRegistrationApp {
    public static void main(String[] args) {
        UserManager userManager = new UserManager();
        Scanner scanner = new Scanner(System.in);

        while (true) {
            System.out.println("1. Register");
            System.out.println("2. Login");
            System.out.println("3. Exit");
            System.out.print("Choose an option: ");
            int choice = scanner.nextInt();
            scanner.nextLine(); // Consume the newline character

            if (choice == 1) {
                System.out.print("Enter your email: ");
                String email = scanner.nextLine();
                System.out.print("Enter your password: ");
                String password = scanner.nextLine();
                System.out.print("Enter your username: ");
                String username = scanner.nextLine();
                userManager.registerUser(email, password, username);
            } else if (choice == 2) {
                System.out.print("Enter your email: ");
                String email = scanner.nextLine();
                System.out.print("Enter your password: ");
                String password = scanner.nextLine();
                User user = userManager.loginUser(email, password);
                if (user != null) {
                    System.out.println("Welcome, " + user.getUsername() + "!");
                    // You can display the logged-in page here.
                } else {
                    System.out.println("Invalid email or password. Please try again.");
                }
            } else if (choice == 3) {
                break;
            } else {
                System.out.println("Invalid choice. Please try again.");
            }
        }
        
        scanner.close();
    }
}

#include "EmonLib.h"
#define VOLT_CAL 126.41

EnergyMonitor emon1;

// Define os pinos dos sensores
const int pinCorrente = A3;

// Variáveis para armazenar os valores lidos
int valorCorrente;


void setup() {
  // Inicialização da porta serial
  Serial.begin(9600);
  emon1.voltage(2, VOLT_CAL, 1.7);
}

void loop() {

  emon1.calcVI(17,2000);
  float supplyVoltage   = emon1.Vrms;


  // Lê os valores dos sensores
  valorCorrente = analogRead(pinCorrente);

  // Converte os valores lidos em corrente reais
  float correnteReal = (valorCorrente - 512.0) * (0.04 / 512.0);

  if (correnteReal < 0) {
    correnteReal = 0;
  }

  // Imprime os valores no monitor serial
  Serial.print("Tensão: ");
  Serial.print(supplyVoltage, 0);
  Serial.print(" V\t");
  Serial.print("Corrente: ");
  Serial.print(correnteReal);
  Serial.print(" A\t");
  Serial.print("Potência: ");
  Serial.print(supplyVoltage, 0 * correnteReal);
  Serial.println(" W");

  delay(1000); // 1 segundo de intervalo
}

