		auxiliar = NULL;
		char busqueda[10];
		long int buscarDNI,aux;
			switch(tipo){
				case 1: mostrarLista(2);	
						cout<<"\n - ELIMINACION POR LEGAJO: \n";
						cout<<"\n\t > SELECCIONE LEGAJO: ";	fflush(stdin);
							cin.getline(busqueda,10,'\n');
								strupr(busqueda);
						if(elemento == NULL){	listaVacia("PRODUCTOS");	saltoDeLinea();		system("pause");	}
						else{	
								while(elemento!= NULL){	
									if(strcmp(busqueda,elemento->legajo) == 0){
										cout<<"\n\n LEGAJO ENCONTRADO Y ELIMINADO. \n\n\n\n";
										auxiliar = elemento->proximo;
										inicio = auxiliar; 
										free(elemento);
										break;
									}
									else{
										if(elemento == NULL){
											cout<<"LEGAJO QUE A INGRESADO NO ESTA REGISTRADO";
										}
									}
									elemento = elemento->proximo;	
								}	
						}
					break;
				case 2:
						mostrarLista(3);
						buscarDNI = takeLongInt("\n > SELECCIONE DNI: ");
						if(elemento == NULL){	listaVacia("PRODUCTOS");	saltoDeLinea();		system("pause");	}
						else{	
								while(elemento!= NULL){	
									if(elemento->dni == buscarDNI){
										cout<<"\n\n DNI ENCONTRADO Y ELIMINADO. \n\n\n\n";
										auxiliar = elemento->proximo;
											inicio = auxiliar; 
												free(elemento);
													break;
									}
									else{
										if(elemento == NULL){
											cout<<"LEGAJO QUE A INGRESADO NO ESTA REGISTRADO";
										}
									}
									elemento = elemento->proximo;	
								}	
						}
					break;
			}
		}
