								break;
						}
			system("cls");  
		}while(opcion!=0);		
	}

from funciones import *
"""{
Los empleados de una empresa han sido separados en dos grupos novatos y 
expertos de acuerdo a su edad y sexo. 

El grupo N (novatos)esta formado por las mujeres con una edad menor a 30 y 
los hombres con una edad menor a 35 y el grupo E por mujeres mayores de 30 y hombres mayores de 35. 

Escribir un programa que pregunte al usuario su nombre, edad y sexo, y muestre por pantalla el 
grupo que le corresponde.}
"""
#NOVATOS:    MUJERES<30; HOMBRES <35
#EXPERTOS:   MUJERES>=30; HOMBRES >=35

def definirSexo():
    print("\t - SELECCIONE SU SEXUALIDAD.\n\t\t1) HOMBRE.\n\t\t2) MUJER.")
    opcion = (int(input("\t > OPCION: ")))
    if opcion == 1:
        tSexo = "HOMBRE"
    else:
        tSexo = "MUJER"
    return tSexo

def definirGrupo2(sexo,edad):
    if sexo == "MUJER" and edad <30:
        return "NOVATA."
    elif sexo == "HOMBRE" and edad <35:
        return "NOVATO."
    elif sexo == "MUJER" and edad >=30:
        return "EXPERTA."
    elif sexo == "HOMBRE" and edad >=35:
        return "EXPERTO."

def definirGrupo(sexo,edad):
    if (sexo == "MUJER" and edad <30) or (sexo == "HOMBRE" and edad <35):
        return "GRUPO DE NOVATOS."
    else:
        return "GRUPO DE EXPERTO."


print("\n")
nombre = input(" > INGRESE SU NOMBRE: ").upper()
sexo = definirSexo()
edad = tomarEdad(" > INGRESE SU EDAD: ",15)
print(f"\n - {nombre}({sexo}) DE {edad} AÑOS -> {definirGrupo(sexo,edad)}\n")
